import React from 'react';
import {BrowserRouter as Route} from 'react-router-dom';
import './App.css';
import AuthCluster from './AuthCluster';
import MainPage from './pages/MainPage';
import AcctPage from './pages/AcctPage';
import ZooPage from './pages/ZooPage';
import Marketplace from './pages/Marketplace';
import AcctNavigation from './pages/AcctNavigation';
import NavBar from './components/menu/NavBar';


import sd from "./assets/img/ZooLogos/SanDiego.png";
import bronx from "./assets/img/ZooLogos/bronx.png";
import oak from "./assets/img/ZooLogos/Oakland.png";
import elm from "./assets/img/ZooLogos/Elmswood.png";

function App() {
  return (
    <div className="App">
      <NavBar />
      <AuthCluster />
      <Route exact path="/" component={MainPage}></Route>
      <Route exact path="/Marketplace" component={Marketplace}></Route>
      <Route exact path="/AcctPage" render={(props) => <AcctPage globalStore={"test"} {...props} /> }></Route>
      <Route exact path="/ZooPage" component={ZooPage}></Route>

    </div>
  );
}
export default App;
